  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'


export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}><MDXTag name="h1" components={components} props={{"id":"introduction"}}>{`Introduction`}</MDXTag>
<MDXTag name="p" components={components}>{`Possimus alias laborum repudiandae eum deserunt quia consequatur quae sint. Quidem autem aspernatur et. Amet nobis quia placeat optio debitis quia. Eum dolorem vitae molestias vero dolore aspernatur voluptas id officia. Quam quod est. Voluptatem inventore incidunt neque sit et est incidunt et reiciendis.`}</MDXTag>
<MDXTag name="p" components={components}>{`Aperiam ut minus dolor qui qui. Itaque consequatur necessitatibus inventore veritatis voluptatem inventore maiores quos dolor. Ut doloremque qui delectus. Enim quibusdam quo perspiciatis sunt. Nihil voluptatem optio dignissimos mollitia voluptatem eligendi aliquam quibusdam. Dolor totam quam unde deserunt et.`}</MDXTag>
<MDXTag name="p" components={components}>{`Fugiat eos fugiat accusamus facilis blanditiis repudiandae architecto molestiae. Et non voluptatem voluptate ipsam quibusdam maxime culpa qui. Qui molestias aut voluptatem. Impedit odio a quis temporibus sed rem.`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-JavaScript"}}>{`const yodata = require('yodata')
`}</MDXTag></MDXTag>
           </MDXTag>
  }
}
